import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";
import { Calendar, Clock, GeoAlt } from 'react-bootstrap-icons';
import Button from 'react-bootstrap/Button';

import upcomingEvents from '../../data/upcomingEvents.json';

function UpcomingEvents() {

    return(
        <>

            <div className="container col-8">
                <div className="row flex-lg-row-reverse align-items-center g-5 py-5">
                <div className="col-10 col-sm-8 col-lg-6">
                    <img src={upcomingEvents[0].image} className="d-block mx-lg-auto img-fluid" alt={upcomingEvents[0].name}loading="lazy"/>
                </div>
                <div className="col-lg-6">
                    <h3 className="fw-bold lh-1 mb-3">{upcomingEvents[0].name}</h3>
                    <p>{upcomingEvents[0].description}</p>
                    <p><span className="icon-circle-white"><Calendar size="16"/></span>Date: {upcomingEvents[0].date}</p>
                    <p><span className="icon-circle-white"><Clock size="16"/></span>Time: {upcomingEvents[0].time}</p>
                    <p><span className="icon-circle-white"><GeoAlt size="16"/></span>Location: {upcomingEvents[0].location}</p>

                    <div className="d-grid gap-2 d-md-flex justify-content-md-start">
                        <Button variant="primary raise" href="#contact-us">More details</Button>
                    </div>

                </div>
                </div>
            </div>
        </>
    );
}

export default UpcomingEvents;
